import React from 'react';
import PropTypes from 'prop-types';

const menu_list = [
  {
    id: 1,
    name: "Margherita Pizza",
    image:
      "data:image/jpeg;base64,",
    rating: 5.0,
  },
  {
    id: 2,
    name: "Pepperoni Pizza",
    image:
      "data:image/jpeg;base64,",
    rating: 4.7,
  },
  {
    id: 3,
    name: "Potato Pizza",
    image:
      "data:image/jpeg;base64,",
    rating: 4.8,
  },
  {
    id: 4,
    name: "Cheese Pizza",
    image:
      "data:image/jpeg;base64,",
    rating: 4.6,
  },
]

function Pizza({ name, image, rating }) {
  return <div>
    <h1>{name}</h1>
    <h3>rating : {rating} / 5.0</h3>
    <img src={image} alt={name} />
  </div>
}

Pizza.propTypes = {
  name: PropTypes.string.isRequired,
  image: PropTypes.string.isRequired,
  rating: PropTypes.number,
};

function App() {
  return (
    <div>
      {menu_list.map(item => (
        <Pizza
          key={item.id}
          name={item.name}
          image={item.image}
          rating={item.rating}
        />
      ))}
    </div>
  );
}

export default App;